db = exports.UCDsql:getConnection()

function createHouses()
	qh = dbQuery(db, "SELECT * FROM `housing_old`")
	result = dbPoll(qh, -1)
	for i, v in ipairs(result) do		
		local resultOwner = result[i].owner
		if (resultOwner) then
			owner = resultOwner
		end
			
		local sale = result[i].sale
		if (sale == 1) then
			modelID = 1273
			forSale = 1
		else
			modelID = 1272
			forSale = 0
		end
		
		local open = result[i].open
		if (open == 1) then
			isOpen = 1
		else
			isOpen = 0
		end
		
		local x, y, z = result[i].x, result[i].y, result[i].z
	
		--housePickup = createPickup(v[2], v[3], v[4], 3, modelID, 0)
		housePickup = createPickup(x, y, z, 3, modelID, 0)
		createBlipAttachedTo(housePickup)
		
		
		-- We set the element data
		setElementData(housePickup, "houseID", i)
		--setElementData(housePickup, "interiorID", v[1])
		--setElementData(housePickup, "streetName", v[5])
		--setElementData(housePickup, "initialPrice", v[6])
		--setElementData(housePickup, "forSale", forSale)
		--setElementData(housePickup, "open", isOpen)
		--setElementData(housePickup, "ownerName", owner)
	end
end
addEventHandler("onResourceStart", resourceRoot, createHouses)

function setHouseData(houseID, column, data)
	if (not houseID) or (not column) or (not data) then
		return nil
	end
	if (type(houseID) ~= "number") then
		return false
	end
	if (type(column) ~= "string") then
		return false
	end
	-- data can be a number, string (json)
	if (type(data) == "table") then
		outputDebugString("You are a fuckhead for trying to save a table to a MySQL database")
		return false
	end
	
	-- Check if the column exists
	-- If it doesn't return and send an error via debugstring
end

function getHouseData(houseID, column, data)
	if (not houseID) or (not column) or (not data) then
		return nil
	end
	
	if (type(houseID) ~= "number") then
		return false
	end
	if (type(column) ~= "string") then
		return false
	end
	if (type(data) ~= "string") or (type(data) ~= "number") then
		return false
	end
	
	-- Check the SQL database for the column name
	
	-- Get the data and return it as its true type (number returns as number, string returns as string)
	return data
end

